DROP TABLE IF EXISTS `likes`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `likes` (
  `id` int unsigned NOT NULL AUTO_INCREMENT COMMENT 'Идентификатор строки',
  `from_user_id` int unsigned NOT NULL COMMENT 'Ссылка на отправителя лайка',
  `to_user_id` int unsigned DEFAULT NULL COMMENT 'Ссылка на получателя лайка',
  `to_media_id` int unsigned DEFAULT NULL COMMENT 'Ссылка на медиафайл',
  `to_messages_id` int unsigned DEFAULT NULL COMMENT 'Ссылка на сообщение',
  `to_posts_id` int unsigned DEFAULT NULL COMMENT 'Ссылка на пост',
  `created_at` datetime DEFAULT CURRENT_TIMESTAMP COMMENT 'Время создания строки',
  `updated_at` datetime DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT 'Время обновления строки',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=101 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci COMMENT='Лайки';
