DROP TABLE IF EXISTS `posts`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `posts` (
  `id` int unsigned NOT NULL AUTO_INCREMENT COMMENT 'Идентификатор строки',
  `from_user_id` int unsigned NOT NULL COMMENT 'Ссылка на создателя поста',
  `body` text CHARACTER SET utf8 COLLATE utf8_unicode_ci NOT NULL COMMENT 'Текст поста',
  `is_visible` tinyint(1) DEFAULT NULL COMMENT 'Признак видимости поста',
  `is_shedule_message` tinyint(1) DEFAULT NULL COMMENT 'Отложенный пост',
  `shedule_message` datetime DEFAULT NULL COMMENT 'Время отложенного поста',
  `media_id` int unsigned DEFAULT NULL COMMENT 'Ссылка на медиафайл',
  `post_themes_id` int unsigned NOT NULL COMMENT 'Ссылка на темы поста',
  `mentioned_friend_nickname_id` int unsigned DEFAULT NULL COMMENT 'Ссылка на никнеймы друзей',
  `counter_likes` int unsigned DEFAULT NULL COMMENT 'Количество лайков',
  `created_at` datetime DEFAULT CURRENT_TIMESTAMP COMMENT 'Время создания строки',
  `updated_at` datetime DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT 'Время обновления строки',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=101 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci COMMENT='Посты пользователя';
/*!40101 SET character_set_client = @saved_cs_client */;

